      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE - col0 NOT IN ( + col0, - col2 * + - 14, - - col1, + 93, - - 39 );
  - name: tab1

outputs:
  - name: q4508.out
    data: |
      51	14	96
      85	5	59
      91	47	68
